//Quick Sort
function quickSort(arr) {
if (arr.length <=1) return arr;
let pivot = arr[arr.length -1];
let left =[];
let right =[];

for (let i = 0; i < arr.length-1; i++) {
	if (arr[i] < pivot) {
		left.push(arr[i])
	} else right.push(arr[i])
}
	return[...quickSort(left), pivot, ...quickSort(right)]
}

//Bubble Sort
function bubbleSort(arr) {
let len = arr.length;
let swapped;
do {
	swapped = false;
	for (let i = 0; i < len; i++) {
		if (arr[i] > arr[i+1]) {
			let tmp = arr[i];
			arr[i] = arr[i+1];
			arr[i+1] = tmp;
			swapped = true;
		}
	}
} while (swapped);
return arr;
}
